%angular
<link rel="stylesheet" href="https://cdnjs.cloudflare.com/ajax/libs/leaflet/0.7.5/leaflet.css" />
<h3>GeoWave Leaflet Map</h3>
<div id="map" style="height: 600px; width: 100%"></div>

<script type="text/javascript">


function initMap() {
    var map = L.map('map').setView([50.00, 10.00], 5);

    var host='localhost';
    mapLink = '<a href="http://www.esri.com/">Esri</a>';
    wholink = 'i-cubed, USDA, USGS, AEX, GeoEye, Getmapping, Aerogrid, IGN, IGP, UPR-EGP, and the GIS User Community';

    var basemaps = {
        OSM: L.tileLayer('http://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png', {
            attribution: 'Map data &copy; <a href="http://openstreetmap.org">OpenStreetMap</a> contributors',
            maxZoom: 15,
            minZoom: 2
        }),
        Satellite:L.tileLayer(
            'http://server.arcgisonline.com/ArcGIS/rest/services/World_Imagery/MapServer/tile/{z}/{y}/{x}', {
            attribution: '&copy; '+mapLink+', '+wholink,
            maxZoom: 18,
        }),
        LANDSAT: L.tileLayer.wms('http://'+host+':8000/geoserver/geowave/wms?', {
            layers: 'geowave:germany_mosaic',
            format: 'image/jpeg'
        })
    };

    var overlays = {
        GPX:L.tileLayer.wms('http://'+host+':8000/geoserver/geowave/wms?', {
            layers: 'geowave:gpxpoint',
            format: 'image/png',
            transparent: true
        }),

        KMeansCentroids:L.tileLayer.wms('http://'+host+':8000/geoserver/geowave/wms?', {
            layers: 'geowave:kmeans-centroids',
            format: 'image/png',
            transparent: true
        }),

        KMeansHulls:L.tileLayer.wms('http://'+host+':8000/geoserver/geowave/wms?', {
            layers: 'geowave:kmeans-hulls',
            format: 'image/png',
            transparent: true
        })
    };

    L.control.layers(basemaps, overlays).addTo(map);

    basemaps.OSM.addTo(map);
}

// ensure we only load the script once, seems to cause issues otherwise
if (window.L) {
    initMap();
} else {
    console.log('Loading Leaflet library');
    var sc = document.createElement('script');
    sc.type = 'text/javascript';
    sc.src = 'https://cdnjs.cloudflare.com/ajax/libs/leaflet/0.7.5/leaflet.js';
    sc.onload = initMap;
    sc.onerror = function(err) { alert(err); }
    document.getElementsByTagName('head')[0].appendChild(sc);
}
</script>

// load centroid data from hdfs
val kmeansText = sc.textFile("/user/zeppelin/kmeans-centroids.csv")

case class KMeansRow(lat: Double, lon: Double, data : String)

def parseLat (wkt: String) : Double = {
   val latStart = wkt.lastIndexOf(" ") + 1
   val latStop = wkt.lastIndexOf(")")
   val latStr = wkt.substring(latStart, latStop)
   return latStr.toDouble
}

def parseLon (wkt: String) : Double = {
   val lonStart = wkt.indexOf("(") + 1
   val lonStop = wkt.indexOf(" ", lonStart)
   val lonStr = wkt.substring(lonStart, lonStop)
   return lonStr.toDouble
}

// split each line, filter out header (starts with "geom"), and map it into data class
val kmeansData = kmeansText.map(s=>s.split(",")).filter(s=>s(0)!="geom").map(
    s=>KMeansRow(parseLat(s(0)), parseLon(s(0)), s(1))
)

// send the results to the front end (Leaflet map)
z.angularBind("pins", kmeansData.collect())

// register a view for SQL queries
kmeansData.toDF().registerTempTable("kmeans")

%angular

<link rel="stylesheet" href="https://cdnjs.cloudflare.com/ajax/libs/leaflet/0.7.5/leaflet.css" />
<h3>Client-side Integration</h3>
<div id="map2" style="height: 600px; width: 100%"></div>

<script type="text/javascript">
function initMap2() {
    var map2 = L.map('map2').setView([52.5, 13.4], 11);

    L.tileLayer('http://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png', {
        attribution: 'Map data &copy; <a href="http://openstreetmap.org">OpenStreetMap</a> contributors',
        maxZoom: 15,
        minZoom: 2
    }).addTo(map2);

    var geoMarkers = L.layerGroup().addTo(map2);
    var markerIcon = L.icon({
        iconUrl: 'https://openstationmap.org/0.2.0/client/leaflet/images/marker-icon.png',
        iconSize: [24, 32],
    });

    var el = angular.element($('#map2').parent('.ng-scope'));
    angular.element(el).ready(function() {
        window.pinWatcher = el.scope().compiledScope.$watch('pins', function(pinList, oldValue) {
            geoMarkers.clearLayers();
            angular.forEach(pinList, function(pin) {
                var marker = L.marker([ pin.lat, pin.lon ], {icon: markerIcon})
                  .bindPopup(pin.data)
                  .addTo(geoMarkers);
            });
        })
    });}

if (window.pinWatcher) {
    // clear existing watcher otherwise we'll have duplicates
    window.pinWatcher();
}

// ensure we only load the script once, seems to cause issues otherwise
if (window.L) {
    initMap2();
} else {
    console.log('Loading Leaflet library');
    var sc = document.createElement('script');
    sc.type = 'text/javascript';
    sc.src = 'https://cdnjs.cloudflare.com/ajax/libs/leaflet/0.7.5/leaflet.js';
    sc.onload = initMap2;
    sc.onerror = function(err) { alert(err); }
    document.getElementsByTagName('head')[0].appendChild(sc);
}
</script>
